A:

I think you are looking for the "live" tag.
http://jsfiddle.net/joshnh/j2Y4N/
$(document).ready(function() {
    $('#fiddle').live('click', function() {
        $('#fiddle').fadeOut(500);
        $('#fiddle').fadeIn(500);
    });
});

A:

You can use the livequery plugin.
http://plugins.jquery.com/project/livequery
$(document).ready(function() {
    $('#fiddle').livequery(function() {
        $('#fiddle').fadeOut(500);
        $('#fiddle').fadeIn(500);
    });
});

